const mongoose = require('mongoose');
const Schema = mongoose.Schema;

const QuestionSchema = new Schema([
  {
    question: {
      type: String,
      required: true,
    },
    answer: {
      type: Number,
      required: true,
    },
  },
]);

export default mongoose.models.Questions || mongoose.model('Questions', QuestionSchema);
